function getPatientName (pt) {
  if (pt.name) {
    var names = pt.name.map(function(name) {
      return name.given.join(" ") + " " + name.family.join(" ");
    });
    return names.join(" / ")
  } else {
    return "anonymous";
  }
}

function getPatientInfo(patientIds, smart) {
	var patientInfo = {};
  patientIds.forEach(function(pid) {
  	smart.api.read({type: "Patient", id: "20711"}).then(function(pt) {
  		patientInfo[pid] = getPatientName(pt.data);
	  });
  })
  return patientInfo;
}



function getLabValues(pat_name, callback) {
    var relCodes = {
      "804-5":"804-5",
      "718-7":"718-7",
      "32693-4":"32693-4",
      "1975-2":"1975-2",
      "2160-0":"2160-0",
      "777-3":"777-3"
    }, sepObs,
    formatObs = function(d) {
            a = d.split("("), b = a[1].split(")");
            return({"type": "pred", "code" : {"coding":[{"code": b[0]}]}, "effectiveDateTime": parseFloat(a[0]), "valueQuantity": {"value": parseFloat(b[1])}});
      }; 
	futObs = getFutObs(), formObs = futObs["attributes"].find(function(d) {return(d.name == "predLabs")}).listValue.values.map(function(d) {return formatObs(d.string)})
      pt = getTmpObs();
      pt = pt.concat(formObs);
      var relObs = pt.map(function(d) {
        if(relCodes[d.code.coding[0].code]) {
          return d;
        }
      }).filter(function(n){ return n != undefined }), 
      groupBy = function(xs, key) {
        return xs.reduce(function(rv, x) {
          (rv[key(x)] = rv[key(x)] || []).push(x);
          return rv;
        }, {});
      },
      func = function (d) {return(d.code.coding[0].code)},
      groupedObs = groupBy(relObs, func);
      sepObs = {
        "804-5":{"data":{"h12": [],"h24": [],"h72": [],"d7": []}, "critical":{"low": 4, "high": 10, "vlow": 2, "vhigh":50}, "sd": 2.7},
        "718-7":{"data":{"h12": [],"h24": [],"h72": [],"d7": []}, "critical":{"low": 11.4, "high": 14.4, "vlow": 6.6, "vhigh":100}, "sd": 0.82},
        "32693-4":{"data":{"h12": [],"h24": [],"h72": [],"d7": []}, "critical":{"low": 0.51, "high": 2.2, "vlow": 0.1, "vhigh":5.01}, "sd": 0.8},
        "1975-2":{"data":{"h12": [],"h24": [],"h72": [],"d7": []}, "critical":{"low": 0.3, "high": 1, "vlow": 0.1, "vhigh":100}, "sd": 0.59},
        "2160-0":{"data":{"h12": [],"h24": [],"h72": [],"d7": []}, "critical":{"low": 0.6, "high": 1.2, "vlow": 0.1, "vhigh": 100}, "sd": 0.27},
        "777-3":{"data":{"h12": [],"h24": [],"h72": [],"d7": []}, "critical":{"low": 150, "high": 400, "vlow": 26, "vhigh":999}, "sd": 51}
      };
      var currentTime = new Date(), h12 = currentTime.setHours(currentTime.getHours() - 12),
      h24 = currentTime.setHours(currentTime.getHours() - 12), h72 = currentTime.setHours(currentTime.getHours() - 48),
      d7 = currentTime.setHours(currentTime.getHours() - 96), len = [].concat.apply([], Object.values(groupedObs)).length;
      Object.keys(groupedObs).forEach((key, index, array) => {
        data = groupedObs[key], lab = key;
        data.forEach(function(d) {
          var value = {type: d.type, 'timestamp': new Date(d.effectiveDateTime), 'value': d.valueQuantity.value}
          if(new Date(d.effectiveDateTime) > h12)
            sepObs[lab]['data']["h12"].push(value);
          else if(new Date(d.effectiveDateTime) > h24)
            sepObs[lab]['data']["h24"].push(value);
          else if(new Date(d.effectiveDateTime) > h72)
            sepObs[lab]['data']["h72"].push(value);
          else if(new Date(d.effectiveDateTime) > d7)
            sepObs[lab]['data']["d7"].push(value);
        });
        if(len === [].concat.apply([], [].concat.apply([], Object.values(sepObs).map(function(d) {return Object.values(d.data)}))).length){
            setTimeout(callback(sepObs, 3), 5000);
      }
      }) 
}